  false,\n\t\"url\": null,\n\t\"notes\": \"Camp Dresser McKee Inc. contracted with
  Sanborn Map Company to provide LiDAR mapping services for Fort Kent, Maine. Utilizing
  multi-return systems, Light Detection and Ranging (LiDAR) data in the form of 3-dimensional
  positions of a dense set of mass points was collected in spring 2009 for 187 square
  miles along the St. Johns River and the Fish River. The Leica ALS-50 LiDAR system
  was used to collect data for the survey campaign. The nominal point spacing of this
  data set is 1.4 meters. Leica ALS-50 LiDAR System Acquisition Parameters: Average
  Altitude: 1400 Meters above ground level Airspeed: ~120 Knots Scan Frequency: 36
  Hertz Scan Width Half Angle: 20 Degrees Pulse Rate: 76,200 Hertz\",\n\t\"license_title\":
